import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";

const PackageDetails = () => {
  const { id } = useParams(); // Assuming the package ID is passed as a URL parameter
  const [packageDetails, setPackageDetails] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Fetch package details from the server
    fetch(`http://localhost:7000/api/v1/Iternaries/get/${id}`)
      .then((response) => {
        if (!response.ok) {
          throw new Error("Failed to fetch package details");
        }
        return response.json();
      })
      .then((data) => {
        console.log("Fetched data:", data); // Debugging
        setPackageDetails(data);
        setLoading(false);
      })
      .catch((err) => {
        setError(err.message);
        setLoading(false);
      });
  }, [id]);

  if (loading) {
    return <p>Loading package details...</p>;
  }

  if (error) {
    return <p>Error: {error}</p>;
  }

  if (!packageDetails) {
    return <p>No package details found.</p>;
  }

  return (
    <div style={{ padding: "20px" }}>
      <h1>{packageDetails.packageName}</h1>
      <img
        src={packageDetails.image_url[0]}
        alt={`${packageDetails.packageName} image`}
        style={{ width: "100%", borderRadius: "8px", marginBottom: "20px" }}
      />
      <p><strong>Price:</strong> ₹{packageDetails.price}</p>
      <p><strong>Duration:</strong> {packageDetails.duration} days</p>
      <p><strong>Highlights:</strong> {packageDetails.highlight}</p>
      <p><strong>Discount:</strong> ₹{packageDetails.discount}</p>

      <h2>Itinerary</h2>
      {packageDetails.itinerary.map((day, index) => (
        <div
          key={index}
          style={{
            marginBottom: "20px",
            padding: "15px",
            border: "1px solid #ccc",
            borderRadius: "8px",
          }}
        >
          <h3>Day {day.dayNumber}</h3>
          <p><strong>Highlights:</strong> {day.highlights}</p>

          <h4>Activities:</h4>
          <ul>
            {day.activities.map((activity) => (
              <li key={activity._id}>
                <strong>{activity.activityName}</strong>: {activity.description} <br />
                <em>Time:</em> {activity.time} <br />
                <em>Location:</em> {activity.location}
              </li>
            ))}
          </ul>

          <h4>Locations:</h4>
          <ul>
            {day.locations.map((location) => (
              <li key={location._id}>
                <strong>{location.name}</strong>: {location.description} <br />
                <em>Address:</em> {location.address}
              </li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
};

export default PackageDetails;
